angular.module("app.core").run(["$templateCache", function($templateCache) {$templateCache.put("app/settings/settings.html","		<section class=\"column\">\n			<div class=\"row badge warning\" data-ng-if=\"vm.options.config.folders.length === 0\">\n				<span>There are no folders elegible for moving. Please enter them, in the input box below</span>\n			</div>\n\n			<div class=\"row\">\n				<form class=\"cd-form\">\n				<fieldset>\n					<legend>Folders elegible for the moving process</legend>\n\n					<p>Specify which folders will be available for moving. All folders should be relative to /mnt/user.</p>\n					<p>For example, you may want to move only movies, but not tvshows. You have /mnt/user/Movies and /mnt/user/TVShows. In the input box below, you would enter Movies.</p>\n\n					<div>\n						<label>Folder</label>\n						<input type=\"text\" placeholder=\"folder elegible for moving\" data-ng-model=\"vm.folder\" data-ng-keyup=\"$event.keyCode == 13 && vm.addFolder()\">\n					</div>\n\n					<div>\n						<a href=\"#\" class=\"btn btn-primary\" data-ng-click=\"vm.addFolder()\">Add</a>\n					</div>\n\n					<legend>Folders Selected</legend>\n\n					<div>\n						<table class=\"settings\">\n						<thead>\n							<tr>\n								<th>#</th>\n								<th>Folder</th>\n							</tr>\n						</thead>\n						<tbody>\n							<tr data-ng-repeat=\"folder in vm.options.config.folders\">\n								<td><a href=\"#\" data-ng-click=\"vm.removeFolder($index)\"><img src=\"/img/no.png\"></a></td>\n								<td>{{folder}}</td>\n							</tr>\n						</tbody>\n						</table>\n					</div>\n				</fieldset>\n				</form>\n			</div>\n			<div class=\"row\">\n				<form name=\"userForm\" data-ng-submit=\"vm.submit(userForm.$valid)\" class=\"cd-form\" novalidate>\n				<fieldset>\n					<legend>Notifications</legend>\n\n					<p>Notify via email when the moving process ends, as well as any errors that may occurr.</p>\n					<p>It will include a list of all the files that take place in the move operation.</p>\n\n					<div>\n						<label>Notifications</label>\n						<input type=\"checkbox\" data-ng-checked=\"{{vm.options.config.notifications}}\" data-ng-model=\"vm.options.config.notifications\" data-ng-change=\"vm.flipNotifications()\"/> \n					</div>\n\n					<div class=\"notifications\" data-ng-if=\"vm.options.config.notifications\">\n						<div>\n							<label>From <span>(Email address you want this email to be sent from)</span></label>\n							<input type=\"email\" name=\"from\" data-ng-model=\"vm.options.config.notiFrom\" required /> \n							<small data-ng-show=\"userForm.from.$invalid && !userForm.from.$pristine && vm.submitted\" class=\"help-block\">Enter a valid From email.</small>\n							<small data-ng-show=\"userForm.from.$error.required && !userForm.from.$pristine && vm.submitted\" class=\"help-block\">Field is required.</small>\n						</div>\n						<div>\n							<label>To <span>(Email address you want this email to be sent to)</span></label>\n							<input type=\"email\" name=\"to\" data-ng-model=\"vm.options.config.notiTo\" required /> \n							<small data-ng-show=\"userForm.to.$invalid && !userForm.to.$pristine && vm.submitted\" class=\"help-block\">Enter a valid To email.</small>\n							<small data-ng-show=\"userForm.to.$error.required && !userForm.to.$pristine && vm.submitted\" class=\"help-block\">Field is required.</small>\n						</div>\n						<div>\n							<label>Server (provider) <span>(SMTP server host)</span></label>\n							<input type=\"text\" name=\"server\" data-ng-model=\"vm.options.config.notiHost\" required /> \n							<small data-ng-show=\"userForm.server.$error.required && !userForm.server.$pristine && vm.submitted\" class=\"help-block\">Field is required.</small>\n						</div>\n						<div>\n							<label>Port <span>(SMTP server port)</span></label>\n							<input type=\"number\" name=\"port\" data-ng-model=\"vm.options.config.notiPort\" min=\"1\" max=\"65535\" required /> \n							<small data-ng-show=\"userForm.port.$error.min && !userForm.port.$pristine && vm.submitted\" class=\"help-block\">Enter a port number between 1 and 65535.</small>\n							<small data-ng-show=\"userForm.port.$error.max && !userForm.port.$pristine && vm.submitted\" class=\"help-block\">Enter a port number between 1 and 65535.</small>\n							<small data-ng-show=\"userForm.port.$error.required && !userForm.port.$pristine && vm.submitted\" class=\"help-block\">Field is required.</small>\n						</div>\n						<div>\n							<label>Encryption <span>(Secure communication using TLS/SSL)</span></label>\n							<input type=\"checkbox\" name=\"encryption\" data-ng-checked=\"{{vm.options.config.notiEncrypt}}\" data-ng-model=\"vm.options.config.notiEncrypt\" /> \n						</div>\n						<div>\n							<label>Username <span>(SMTP server user name)</span></label>\n							<input type=\"text\" name=\"username\" data-ng-model=\"vm.options.config.notiUser\" required /> \n							<small data-ng-show=\"userForm.username.$error.required && !userForm.username.$pristine && vm.submitted\" class=\"help-block\">Field is required.</small>\n						</div>\n						<div>\n							<label>Password <span>(SMTP server password)</span></label>\n							<input type=\"password\" name=\"password\" data-ng-model=\"vm.options.config.notiPassword\" required /> \n							<small data-ng-show=\"userForm.password.$error.required && !userForm.password.$pristine && vm.submitted\" class=\"help-block\">Field is required.</small>\n						</div>\n						<div>\n							<button class=\"btn btn-primary\">Submit</button>\n						</div>\n					</div>\n				</fieldset>				\n				</form>\n			</div>\n			</form>\n\n		</section>");
$templateCache.put("app/template/main.html","		<section class=\"column\">\n			<div class=\"row badge warning\" data-ng-if=\"!vm.ok\">\n				<span>The array is not operational. Please start the array first.</span>\n			</div>\n\n			<div class=\"row dashboard-header\">\n				<div class=\"dashboard-status\">\n					STATUS: &nbsp; <span class=\"label\" data-ng-class=\"vm.ok ? \'label-success\' : \'label-warning\'\">{{vm.condition.state | lowercase}}</span>\n				</div>\n\n				<div class=\"loading\" data-ng-if=\"vm.showProgress\">\n				  <div class=\"loading-bar\"></div>\n				  <div class=\"loading-bar\"></div>\n				  <div class=\"loading-bar\"></div>\n				  <div class=\"loading-bar\"></div>\n				</div>		\n\n				<div class=\"dashboard-commands\">\n					<span>&nbsp;</span>\n					<button class=\"btn btn-primary\" data-ng-click=\"vm.calculateBestFit()\" data-ng-disabled=\"vm.disableCalcCtrl\">CALCULATE</button>\n					<span>&nbsp; | &nbsp;</span>\n					<button class=\"btn btn-primary\" data-ng-click=\"vm.move()\" data-ng-disabled=\"vm.disableMoveCtrl\">MOVE</button>\n					<div class=\"dryrun\"> <input type=\"checkbox\" data-ng-checked=\"{{vm.options.config.dryRun}}\" data-ng-model=\"vm.options.config.dryRun\" data-ng-change=\"vm.flipDryRun()\" data-ng-class=\"{disabled: vm.disableControls}\" /> <span>dry-run </span> </div>\n				</div>				\n			</div>\n\n			<div class=\"row console\" data-ng-if=\"vm.showConsole\">\n				<div class=\"console__lines\" unb-scroll-bottom=\"vm.lines\">\n					<p ng-repeat=\"line in vm.lines track by $index\" class=\"console__line\">{{line}}</p>\n				</div>\n			</div>\n\n			<table class=\"row dashboard\" data-ng-if=\"vm.ok\">\n			<thead>\n				<tr>\n			        <th>DISK</th>\n			        <th>SERIAL</th>\n			        <th>FROM </th>\n			        <th>TO</th>\n			        <th>SIZE</th>\n			        <th>FREE</th>\n			        <th>FILL</th>\n			        <th>PLAN</th>\n				</tr>\n			</thead>\n			<tbody>\n				<tr data-ng-repeat=\"disk in vm.disks\">\n			        <td>{{disk.path|replace:\"/mnt/\":\"\"}}</td>\n			        <td>{{disk.serial}} ({{disk.device}})</td>\n			        <td><input type=\"checkbox\" data-ng-checked=\"{{vm.fromDisk[disk.path]}}\" data-ng-model=\"vm.fromDisk[disk.path]\" data-ng-change=\"vm.checkFrom(disk.path)\"/> </td>\n			        <td><input type=\"checkbox\" data-ng-checked=\"{{vm.toDisk[disk.path]}}\" data-ng-model=\"vm.toDisk[disk.path]\" data-ng-change=\"vm.checkTo(disk.path)\"/> </td>\n			        <td>{{disk.size|humanBytes}}</td>\n			        <td>{{disk.free|humanBytes}}</td>\n			        <td>\n			            <div class=\"progress\">\n			                <span style=\"width: {{ ((disk.size - disk.free) / disk.size ) | percentage}}\"></span>\n			            </div>\n			        </td>\n			        <td>\n			            <span data-ng-class=\"{label: disk.newFree !== disk.free, \'label-success\': disk.newFree !== disk.free}\">{{disk.newFree|humanBytes}}</span>\n			        </td>				\n				</tr>\n                <tr>\n                    <td colspan=\"4\">TOTAL</td>\n                    <td>{{vm.condition.size|humanBytes}}</td>\n                    <td>{{vm.condition.free|humanBytes}}</td>\n                    <td>\n                        <div class=\"progress\">\n                            <span style=\"width: {{ ((vm.condition.size-vm.condition.free) / vm.condition.size ) | percentage}}\"></span>\n                        </div>\n                    </td>\n                    <td>{{vm.condition.free|humanBytes}}</td>\n                </tr>\n			</tbody>\n			</table>\n		</section>\n");}]);